%[text] # Tutorial for Mirror
%[text] # ![](text:image:1b06)
%[text] ## Model
%[text] ##  $H\\left(k\_z\\right)=\\left(\\begin{array}{ccc}\n0 & T\_{12} \\exp \\left(-i k\_z \\cdot a / 3\\right) & T\_{13} \\exp \\left(+i k\_z \\cdot a / 3\\right) \\\\\nT\_{21} \\exp \\left(+i k\_z \\cdot a / 3\\right) & 0 & T\_{23} \\exp \\left(-i k\_z \\cdot a / 3\\right), \\\\\nT\_{31} \\exp \\left(-i k\_z \\cdot a / 3\\right) & T\_{32} \\exp \\left(+i k\_z \\cdot a / 3\\right) & 0\n\\end{array}\\right)$
%[text] $T\_{i j}\\left(\\phi\_{i j}, \\theta\_{i j}\\right)=\\left(\\begin{array}{ccc}\nt\_{i j, x x} & t\_{i j, x y} & t\_{i j, x z} \\\\\nt\_{i j, y x} & t\_{i j, y y} & t\_{i j, y z} \\\\\nt\_{i j, z x} & t\_{i j, z y} & t\_{i j, z z}\n\\end{array}\\right)$
%[text] ![](text:image:799e)
%[text] ![](text:image:3224)
%[text] ![](text:image:28dc)
%[text] ## Construct SKTB
%%
%[text] ### Generate POSCAR
N=3;               % number of atoms within one helical unit cell
chirality = -1;       % +1 (-1) for right- (left-) handedness
%%

H_chain = HR(N*3);
H_chain.Rm = diag([1,1,N]);
iatom=1;                                                                %%%
coordinate=zeros(N,3,'sym');                                       %%%
for iN=1:N                                                          %%%
    theta=2*pi/N*(iN-1)*chirality;                                  %%%
    x = 1*cos(theta);                                          %%%
    y = 1*sin(theta);                                          %%%
    z = (iatom-1)*1;                                          %%%
    coordinate(iatom,:)=[x,y,z];                                    %%%
    iatom=iatom+1;                                                  %%%
end 
coordinate = kron(coordinate,[1;1;1]) %[output:05d74d5f]
H_chain.elementL = ones(9,1)*6;
H_chain.quantumL = kron([1;1;1],[2 1 1 nan;2 1 -1 nan;2 1 0 nan]);
% H_chain_check.Rm(3,3) = 3;
%[text] 进行 nn 搜索
%[text] - 这里 search\_range 取 【0 0 1】因为是 只考虑 z方向
%[text] - Accuracy 取小数点3位，maxR值取 1.9 埃
%[text] - search\_range = \[0 0 1\]; \
Accuracy = 1e-4;
r_max_search = 2.8;
search_range = [0 0 1];
%[text] - 我们p轨道的劈裂 \
H_chain.Rm(3,3) = 3;
bond  = 1;
H_chain.Rm(1,1) = 3*sym(bond/2/sin(pi/N));
H_chain.Rm(2,2) = 3*sym(bond/2/sin(pi/N));
H_chain.Rm = sym(H_chain.Rm) %[output:46e8983c]
H_chain.orbL = [1/2,1/2,0]+...
    1/3*...
   coordinate;
H_chain.orbL %[output:84f20c1a]
H_chain.Rm %[output:145afdd3]
% H_chain.POSCAR_gen
H_chain = H_chain.nn(search_range,Accuracy ,r_max_search); %[output:6dfe2b43]
H_chain = H_chain.H_TBSK_gen('level_cut',1,'per_dir',[0 0 1],'onsite',false); %[output:61edc42f]
H_chain.Rm(3,3) = 1 %[output:12d7f186]
H_chain.sym("simple",1) %[output:82906d8b]
H_chain.show; %[output:26fe2a51]
H_chain.list; %[output:76776796] %[output:4eb315b7]
%%
E__6_1 = 0; %[control:slider:2ad2]{"position":[10,11]}
VppP_1 = -0.5; %[control:slider:1116]{"position":[10,14]}
VppS_1 = 1.5; %[control:slider:4db4]{"position":[10,13]}
Fermi  = 0; %[control:slider:3a0e]{"position":[10,11]}
H_chain_check_n = H_chain.Subsall();
lz = [0 -1i 0;1i 0 0;0 0 0];
Lz = kron(eye(3),lz) %[output:35fe799d]
%[text] - 生成能带 \
H_chain_check_n.orbL = double(H_chain_check_n.orbL) %[output:79af9bd7]
H_chain_check_n.Rm = double(H_chain_check_n.Rm) %[output:6f39b956]
[EIGENCAR_R,~,WEIGHTCAR_R] = H_chain_check_n.EIGENCAR_gen('WEIGHTCAR',1,'Oper',Lz); %[output:287e0a66]
%[text] - 画出能带 \

%%
BasisFunction = BasisFunc(H_chain) %[output:17cb3527]
M_y = Oper.mirror([0,1,0]);
M_y = M_y.attachRm(H_chain.Rm);
[H_chain_L,M_y] = H_chain.rotate(M_y) %[output:145f62dd] %[output:963765f4]
H_chain_L_check_n = H_chain_L.Subsall();
[EIGENCAR,~,WEIGHTCAR] = H_chain_L_check_n.EIGENCAR_gen('WEIGHTCAR',1,'Oper',Lz); %[output:0e1d9bd0]
%%
[fig,Ax] = Figs(2,2); %[output:4b316eff]
pbandplot(real(WEIGHTCAR_R),EIGENCAR_R,'Ecut',[-2.5,2.5],'ax',Ax(1)); %[output:4b316eff]
title(Ax(1),'Handedness:-1'); %[output:4b316eff]
ylabel(Ax(1),'Energy')  %[output:4b316eff]
xticklabels(Ax(1),{'-Z','\Gamma','Z'}) %[output:4b316eff]
xlabel(Ax(1),'k_z'); %[output:4b316eff]
pbandplot(real(WEIGHTCAR),EIGENCAR,'Ecut',[-2.5,2.5],'ax',Ax(2)); %[output:4b316eff]
colormap(Ax(1),ColorMap.redbluegrey) %[output:4b316eff]
colormap(Ax(2),ColorMap.redbluegrey) %[output:4b316eff]
colorbar(Ax(1)); %[output:4b316eff]
colorbar(Ax(2)); %[output:4b316eff]
title(Ax(2),'Handedness:+1'); %[output:4b316eff]
ylabel(Ax(2),'Energy') ; %[output:4b316eff]
xticklabels(Ax(2),{'-Z','\Gamma','Z'}); %[output:4b316eff]
xlabel(Ax(2),'k_z'); %[output:4b316eff]
H_chain.show('ax',Ax(3)); %[output:4b316eff]
H_chain_L.show('ax',Ax(4)); %[output:4b316eff]
view(Ax(3),80,60); %[output:4b316eff]
view(Ax(4),80,60); %[output:4b316eff]
set(fig,'Position',[0 0 16 9]*300) %[output:4b316eff]
%%
% H_chain_L = H_chain;
% H_chain_L.orbL  = zeros(9,3);
% H_chain_L = H_chain_L.applyRU(M_y) 
% H_chain_L.HcoeL
% H_chain_L.orbL = orbL_chiral;
% H_chain_L.list();
% H_chain
% H_chain_L.show()
%%
syms k_y true
A = H_chain.sym('simple',1);% Handedness_R_Hsym
B =  M_y.U*subs(A,k_y,-k_y)/M_y.U;% Handedness_L_Hsym with bloch form
%%
D = H_chain_L.sym('simple',1)% Handedness_L_Hsym with rotate Hr_R %[output:282c58cf]
%%
