H_chain.orbL %[output:53871dc1]
H_chain.Rm %[output:89b624b7]
% H_chain.POSCAR_gen
H_chain = H_chain.nn(search_range,Accuracy ,r_max_search); %[output:23eb310b]
H_chain = H_chain.H_TBSK_gen('level_cut',1,'per_dir',[0 0 1],'onsite',false); %[output:1d6c9c97]
H_chain.Rm(3,3) = 1 %[output:4f851c85]
C = H_chain.sym("simple",1);% Handedness_L_Hsym with structure:L
%%
disp('Handedness:R Hsym') %[output:43aad27d]
A %[output:5435cfdd]
disp('Handedness:L Hsym Bloch form under My') %[output:475f4eaa]
B %[output:015cdb77]
disp('Handedness:L Hsym, hr by My') %[output:41fd6cd6]
C %[output:10892e9c]
disp('Handedness:L Hsym, From structure-L') %[output:04aaed2f]
D %[output:68215021]
